transforms.result:
@tailwind base;
@tailwind components;
@tailwind utilities;

:root{
    --text-color : #232C33
}

html{
    min-height: 100vh;
    min-width: 100vw;
}
#__nuxt {
    @apply h-full w-full flex flex-col;
  }
body {
    min-height: 100vh;
    min-width: 100vw;
    position: relative;
    color: #232C33;
    display:flex;
    flex-direction: column;
    justify-content: stretch;
}

.background{
    background-image:url('~/assets/images/background3.jpg');
    background-position: center;
    background-size: cover;
    background-repeat: no-repeat;
    min-height: 100vh;
    width: 100%;
    position: fixed;
    top: 0;
    z-index: -1;
}

